import './App.css'
import Cards from  './components/Cards/Cards.jsx';
import characters from './data.js';
import Nav from './components/Nav/Nav.jsx';

function App () {
  return (
    <div className='App' style={{ padding: '25px' }}>
      <div>
        <Nav />
      </div>
     <div>
        <Cards
          characters={characters}
          />
      
      </div>
      </div>
  )
}

export default App;
